import React, { Component } from 'react';
import { Post } from '../components/Post'
import { GetAllPosts } from '../store/actions/PostAction'

class home extends Component {
    render() {
		const posts = GetAllPosts();
	    return (
		    <div> 
		        <Post posts={posts}/>
		    </div>
	    );
	}

}

export default home
